import { Link } from "react-router-dom";
import "./navbar.css";

function Navbar() {
  return (
    <nav className="navbar">
      <p>Streamline Your Scheduling</p>

      <ul>
        <li>
          <Link to="createEvent/">Schduler</Link>
        </li>
        <li>
          <Link to="/getEvent">Show My Schdules</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
